import React from "react";
import Collapsible from "react-collapsible";

import "./ProjectItem.css";

const ProjectItem = props => {
  return (
    <Collapsible trigger={props.triggerTitle} className="projectItem__wrapper">
      <img className="projectItem__img" src={props.img} />
      <p className="projectItem__paragraph">{props.children}</p>
    </Collapsible>
  );
};

export default ProjectItem;
